import React from "react";
import Carousel from 'nuka-carousel';
export const Slider: React.FC<ISlider> = props => (
    <Carousel>{props.imgArray.map(img => <img src={img} alt="slide"/>)}</Carousel>
);

interface ISlider {
    imgArray: string[];
}
